import React from 'react'
import { useParams } from 'react-router-dom';
import { useDispatch,useSelector } from 'react-redux';
const Details = () => {
    const {id}=useParams();
    const dispatch=useDispatch()
    console.log(id)
    useEffect(() => {
        
        dispatch({type:"Product",id})
        
    }, [id])
    return (
        <div>
            Details
        </div>
    )
}

export default Details
